// src/pages/Home.js

import React from 'react';
import { Link } from 'react-router-dom';
import styles from './Home.module.css';

const Home = () => {
  return (
    <div className={styles.homepage}>
      <h1>Welcome to ProjectReserva</h1>
      <p>Your go-to platform for booking bus tickets hassle-free!</p>
      <div>
        <Link to="/cancel-booking">Cancel Booking</Link>
        <Link to="/shops">Nearby Shops</Link>
        <Link to="/chat">Chat with Us</Link>
        <Link to="/report-missing-bag">Report Missing Bag</Link>
        <Link to="/dynamic-pricing">Dynamic Pricing</Link>
      </div>
    </div>
  );
};

export default Home;
